import s from "../MyPosts.module.css";
import React from "react";

const Item = () => {
    return (
        <div className={s.item}>
            <img src="https://avatars2.githubusercontent.com/u/48174604?s=460&u=8d945fe7286284167189cb443a159caff9b44c4d&v=4" alt=""/>
            Post1
        </div>
    )
};

export default Item
